import "./App.css";
import HomePage from "./Pages/Home_page/Home_page";
import { BrowserRouter as Router, Route, Routes} from "react-router-dom";
import { PizzaListPage } from "./utils";


function App() {
    const navigate = useNavigate();

   const hanleNavToPizzaList = ()=>{
    navigate('/standart-pizza-list')
   }

  return (

    <Router>
    <div>
    <button onClick={hanleNavToPizzaList}>Standart Pizza</button>
    </div>
      <Routes>
        <Route path="/" element={<HomePage />} /> 
        <Route path="/standart-pizza-list" element={<PizzaListPage />} /> 
      </Routes>
    </Router>
  )
}

export default App;
